listings.Eviction_History:
1.	No negative Unlawful Detainer Report indicating repeated failure to meet financial obligations in past tenant history 
2.	No eviction for cause within the past 24 months
3.	No unpaid balance due a current or prior landlord within the past 24 months
4.	References from applicant’s current and previous landlords for a period of twenty-four months will be reviewed. 
5.	All applicants must have positive prior landlord references indicating ability to care for the property and pay rent on time, as well as the ability to peacefully cohabitate with other residents. 
6.	Demonstrated ability and willingness to keep lease agreements, including:  pay rent on time, maintain the unit in good condition, respond to recertification requirements, cooperative occupancy habits (noise, trash, etc.), no family member uses illegal drugs.  This information is obtained from prior landlords, personal and credit references.
7.	A landlord reference check of an applicant’s rental history for the past 24 months is conducted to determine the following:
a)	Demonstrated ability to pay rent on time and in full;
b)	Demonstrated ability to live peacefully with others
c)	Followed the rules and regulations of rental companies;
d)	Kept rental unit in a manner which did not create an unsafe or unhealthy environment or pose a health danger to other residents;
e)	Kept rental unit undamaged;
f)	No history of receiving notices for lease violations;
g)	Gave sufficient notice of intent to vacate;
h)	No noise complaints;
i)	No disturbances or illegal activities, as permitted under the City of San Francisco Fair Chance Ordinance;
j)	No unpaid Non-Sufficient Funds (NSF) checks;
k)	No unauthorized household members
l)	No blatant disrespectful, disruptive or antisocial behavior toward the management or staff, the property, or other applicants/residents
m)	No convictions for the manufacture or distribution of controlled substances
n)	No eviction for cause
o)	No destruction or theft of property

